import React, { Suspense } from 'react';
import './App.css';

import { fetchGenreData } from './API_requests/test_request'

const resource = fetchGenreData();

const App = () => (
  <div className='container my-5'>
    <Suspense fallback={<h1>Loading Genre</h1>}>
      <GenrePad />
    </Suspense>
  </div>
);

const GenrePad = () =>
{
  const genre = resource.genre.read();
  return (
    <div className='card card-body my-3'>
      <h1 className='large text-primary'>{genre.name}</h1>
      <h3>
          Identifier: {genre.id}
      </h3>
      <h3>
          Date Created: {genre.date_added}
      </h3> 
    </div>
  )
}

export default App;
